INSERT INTO `v1_c9b2c9d69ebcad7f483791d4df51b0de614b2e4c37b3ad951ae702bde064cf64` VALUES (0, 23814, 10, 23814070, 100811, "今日は何の日か、もちろん分かるよね？\nこの世で一番かわいくて美しいボクが\n誕生して、みんなの美意識が刷新された\nことをお祝いする、世界的記念日だよ♪", 1, 1, 0, 11, 0.5);
